import React from "react"

import SearchLocations from "./SearchLocations"
function LocationCard(props){
    return (
        <div>
            <div className = "mobile-container" style = {{overflow:"visible",padding:"0px 10px"}}>

            {props.hasLoaded&&<h3 style = {{padding:"5px 0px"}}><span style = {{color:"#aaaaaa" }} >Around </span>{props.selectedLocation}</h3>}
            <SearchLocations {...props} handleLocationChange = {props.handleLocationChange}/>
            </div>



            <div style = {{height:0,clear:"both"}}/>

        </div>
    )
}
export default LocationCard
